    fetch("/items?search=playstation")
      .then((res) => res.json())
      .then((data) => setData(data));
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <Header />
        {/* <ul>
          {data?.items?.map((item, index) => {
            return <li key={index}>{item.title}</li>;
          })}
        </ul> */}
      </header>
    </div>
  );
}

export default App;
